import { useState } from "react";
import { useHistory } from "react-router";
import TextField from "@material-ui/core/TextField";
import './index.css'

function CourseEntry() {
    let history = useHistory();
    const [courseId, setcourseId] = useState('')
    const [professorName, setProfessorName] = useState('')
    const [courseName, setCourseName] = useState('')

    const clickEntry = () => {
        const course = {'course_id': courseId, 'professor_name':professorName, 'course_name':courseName}
        console.log({'courseID': courseId, 'professorname':professorName, 'coursename':courseName})
        const request = new Request('http://34.126.85.190:8080/course/add', {
            method: "POST",
            body: JSON.stringify(course),
            mode: 'no-cors',
            headers: {
                Token: 'fc337701563a4b41814f00c061fe6f72',
                Accept: "application/json, text/plain, */*",
                "Content-Type": "application/json"
            }
        });
        fetch(request)
            .then(function(res) {
            console.log(res.status)
            if (res.status === 0) {
                alert('sign up success')
                console.log('success')
                // history.push("/dashboard");
            } else {
                alert('sign up failed') 
            }
            })
            .catch(error => {
            console.log(error);
            });
    }

    return (
        <div className="courseEntry">
            <h2>Create a new Course Entry</h2>
            <a href="/dashboard">Go back to dashboard </a>
            <div>
                <TextField
                    name="courseid"
                    label="Course ID"
                    id="outlined-basic"
                    variant='outlined'
                    margin="normal"
                    onChange={e => setcourseId(e.target.value)}
                />
            </div> 
            <div>
                <TextField
                    name="professorname"
                    label="Prefessor Name"
                    id="outlined-basic"
                    variant='outlined'
                    margin="normal"
                    onChange={e => setProfessorName(e.target.value)}
                />
            </div>
            <div>
                <TextField
                    name="coursename"
                    label="Course Name"
                    id="outlined-basic"
                    variant='outlined'
                    margin="normal"
                    onChange={e => setCourseName(e.target.value)}
                />
            </div>
            <button className="small green button" onClick={clickEntry}>
                Complete
            </button>
        </div>
    );
  }

  export default CourseEntry;
